//componets
import React from "react";
import ReactDOM from "react-dom";
//
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";
import { useParams, useHistory } from "react-router";

import "./css/index.css";

//componets//

import {Header, Footer, AuthProvider, PrivateRoute} from "./componets/commons/index";

//main
import {Consultar, Inicio, Contacto, Registrarse, Registrarse2} from "./componets/pages/index"


//main//

//componets//

//header
//header//
//footer
//footer//
//main
const mainElement = document.getElementById("main");

function App() {
  return (
    <BrowserRouter>
      <AuthProvider>
        <Switch>
          <Route exact path="/">
            <header>
            <Header/>
            </header>
            <main>
            <Inicio />
            </main>
            <footer>
            <Footer/>
            </footer>
          </Route>
          <Route path="/consultar">
            <Consultar />
          </Route>
          <Route path="/contacto">
            <Contacto />
          </Route>
          <Route path="/registrarse">
        <Registrarse/>
          </Route>
          <Route path="/registrarse2">
        <Registrarse2/>
          </Route>
          <Route path="*">
            <NotFound />
          </Route>
        </Switch>
        <PrivateRoute path="/user">

        </PrivateRoute>
      </AuthProvider>
    </BrowserRouter>
  );
}
function NotFound() {
  return <h3>Not Found</h3>;
}

ReactDOM.render(<App />, mainElement);
//main//
